function Meniu(props) {
  return (
    <nav>
      <ul className={props.klase} style={props.stilius}>
        {props.komandos.map((komanda, index) => (
          <li key={index}>
            <Link to={komanda.adresas}>{komanda.pavadinimas}</Link>
          </li>
        ))}
      </ul>
    </nav>
  );
}
